%% Step 7: 平日/週末の比較分析
% 目的：「時系列相関が顧客層の違いを反映する」という仮説を検証する。
%       平日と週末で顧客層が異なると仮定し、相関パターンの差異を分析する。
%
% 入力: step6_results.mat
% 出力: step7_results.mat

clear; clc; close all;
%%
%% 1. 設定
set(0, 'DefaultAxesFontName', 'MS Gothic');
set(0, 'DefaultTextFontName', 'MS Gothic');
set(0, 'DefaultAxesFontSize', 10);

baseDir = '/MATLAB Drive/DAC25';
dataDir = fullfile(baseDir, '01_Data');
outputDir = fullfile(baseDir, '03_Visualization');
if ~exist(outputDir, 'dir'), mkdir(outputDir); end

%%
%% 2. Step6の結果をロード
fprintf('\nStep6の結果をロード中...\n'); %[output:72fe089d]

step6Path = fullfile(dataDir, 'step6_results.mat');
if ~exist(step6Path, 'file')
    error('step6_results.mat が見つかりません。Step6を先に実行してください。');
end

load(step6Path);
fprintf('完了\n'); %[output:9386311a]

salesMatrix = step6Results.salesMatrix;
uniqueDates = step6Results.uniqueDates;
uniqueCategories = step6Results.uniqueCategories;
nCategories = size(salesMatrix, 1);

%%
%% 3. 平日/週末の分離
% 曜日: 1=日, 2=月, 3=火, 4=水, 5=木, 6=金, 7=土
weekdayVec = weekday(uniqueDates);

% 平日 (月-金: 2-6) と週末 (土日: 1,7)
isWeekday = ismember(weekdayVec, 2:6);
isWeekend = ismember(weekdayVec, [1, 7]);

nWeekday = sum(isWeekday);
nWeekend = sum(isWeekend);

fprintf('\n分析対象:\n'); %[output:98fc37ad]
fprintf('  カテゴリ数: %d\n', nCategories); %[output:73a76d1c]
fprintf('  平日: %d日\n', nWeekday); %[output:113fed0f]
fprintf('  週末: %d日\n', nWeekend); %[output:0b484a28]

%%
%% 4. 平日/週末それぞれの相関行列を計算
fprintf('\n相関行列を計算中...\n'); %[output:70fe92ef]

salesMatrix_weekday = salesMatrix(:, isWeekday);
corrMatrix_weekday = corrcoef(salesMatrix_weekday');

salesMatrix_weekend = salesMatrix(:, isWeekend);
corrMatrix_weekend = corrcoef(salesMatrix_weekend');

fprintf('完了\n'); %[output:8a0d1c85]

%%
%% 5. 結果の比較と評価
fprintf('\n--- 結果の評価 ---\n'); %[output:4573cdad]

% 上三角行列のみを抽出
upper_tri_mask = triu(true(nCategories), 1);
vec_weekday = corrMatrix_weekday(upper_tri_mask);
vec_weekend = corrMatrix_weekend(upper_tri_mask);

% 行列間の類似度（ベクトル間相関）
matrix_similarity = corr(vec_weekday, vec_weekend);

% 差分
corr_diff = corrMatrix_weekend - corrMatrix_weekday;
vec_diff = corr_diff(upper_tri_mask);

fprintf('\n========== 結果サマリ ==========\n'); %[output:242e97a2]
fprintf('平日-週末の相関行列類似度: r = %.3f\n', matrix_similarity); %[output:42ba9afa]
fprintf('差分の平均: %.3f\n', mean(vec_diff)); %[output:7569d315]
fprintf('差分の標準偏差: %.3f\n', std(vec_diff)); %[output:7fe5313b]
fprintf('================================\n'); %[output:5554711b]

% インデックス取得
[row, col] = find(upper_tri_mask);

% 週末で相関が強くなるペア
[sorted_desc, idx_desc] = sort(vec_diff, 'descend');
fprintf('\n--- 週末で相関が強くなるペア (TOP 5) ---\n'); %[output:8cafc95a]
for i = 1:min(5, length(sorted_desc)) %[output:group:72e3c18e]
    r_idx = row(idx_desc(i));
    c_idx = col(idx_desc(i));
    fprintf('%d. カテゴリ%2d vs カテゴリ%2d (平日:%.2f -> 週末:%.2f, 差:+%.2f)\n', ... %[output:57af2c45]
        i, uniqueCategories(r_idx), uniqueCategories(c_idx), ... %[output:57af2c45]
        corrMatrix_weekday(r_idx, c_idx), corrMatrix_weekend(r_idx, c_idx), ... %[output:57af2c45]
        sorted_desc(i)); %[output:57af2c45]
end %[output:group:72e3c18e]

% 平日で相関が強くなるペア
[sorted_asc, idx_asc] = sort(vec_diff, 'ascend');
fprintf('\n--- 平日で相関が強くなるペア (TOP 5) ---\n'); %[output:68556e4b]
for i = 1:min(5, length(sorted_asc)) %[output:group:84117107]
    r_idx = row(idx_asc(i));
    c_idx = col(idx_asc(i));
    fprintf('%d. カテゴリ%2d vs カテゴリ%2d (平日:%.2f -> 週末:%.2f, 差:%.2f)\n', ... %[output:6dc7fd95]
        i, uniqueCategories(r_idx), uniqueCategories(c_idx), ... %[output:6dc7fd95]
        corrMatrix_weekday(r_idx, c_idx), corrMatrix_weekend(r_idx, c_idx), ... %[output:6dc7fd95]
        sorted_asc(i)); %[output:6dc7fd95]
end %[output:group:84117107]

%%
%% 6. 可視化
fprintf('\n結果を可視化中...\n'); %[output:011e6842]

fig1 = figure('Name', '平日/週末比較', 'Position', [50 50 1800 600]); %[output:9dc6e9d9]

% (a) 平日の相関行列
subplot(1, 3, 1); %[output:9dc6e9d9]
imagesc(corrMatrix_weekday); %[output:9dc6e9d9]
title(sprintf('(a) 平日 (n=%d日)', nWeekday)); %[output:9dc6e9d9]
axis square; colorbar; colormap('jet'); caxis([-1 1]); %[output:9dc6e9d9]
xlabel('カテゴリ'); ylabel('カテゴリ'); %[output:9dc6e9d9]

% (b) 週末の相関行列
subplot(1, 3, 2); %[output:9dc6e9d9]
imagesc(corrMatrix_weekend); %[output:9dc6e9d9]
title(sprintf('(b) 週末 (n=%d日)', nWeekend)); %[output:9dc6e9d9]
axis square; colorbar; colormap('jet'); caxis([-1 1]); %[output:9dc6e9d9]

% (c) 差分
subplot(1, 3, 3); %[output:9dc6e9d9]
imagesc(corr_diff); %[output:9dc6e9d9]
title('(c) 差分 (週末 - 平日)'); %[output:9dc6e9d9]
axis square; colorbar; colormap('jet'); caxis([-0.5 0.5]); %[output:9dc6e9d9]

sgtitle('Step 7: 平日/週末 相関行列の比較', 'FontSize', 14, 'FontWeight', 'bold'); %[output:9dc6e9d9]

saveas(fig1, fullfile(outputDir, 'Step7_Corr_Matrices.png')); %[output:9dc6e9d9] %[output:9e6f7a91]

% 追加の可視化
fig2 = figure('Name', '平日/週末比較2', 'Position', [100 100 1200 600]); %[output:60d90e18]

% (d) 散布図
subplot(1, 2, 1); %[output:60d90e18]
scatter(vec_weekday, vec_weekend, 30, 'filled', 'MarkerFaceAlpha', 0.5); %[output:60d90e18]
hold on; %[output:60d90e18]
plot([-1 1], [-1 1], 'r--', 'LineWidth', 1.5); %[output:60d90e18]
xlabel('平日の相関係数'); %[output:60d90e18]
ylabel('週末の相関係数'); %[output:60d90e18]
title(sprintf('(d) 平日 vs 週末\n行列間類似度 r = %.3f', matrix_similarity)); %[output:60d90e18]
axis square; grid on; %[output:60d90e18]
xlim([-0.5 1]); ylim([-0.5 1]); %[output:60d90e18]

% (e) 差分の分布
subplot(1, 2, 2); %[output:60d90e18]
histogram(vec_diff, 50); %[output:60d90e18]
xlabel('相関係数の差分 (週末 - 平日)'); %[output:60d90e18]
ylabel('ペア数'); %[output:60d90e18]
title('(e) 差分の分布'); %[output:60d90e18]
xline(mean(vec_diff), 'r--', 'LineWidth', 2); %[output:60d90e18]
xline(0, 'k-', 'LineWidth', 1); %[output:60d90e18]
grid on; %[output:60d90e18]
text(mean(vec_diff)+0.02, max(ylim)*0.9, sprintf('平均: %.3f', mean(vec_diff)), 'Color', 'r'); %[output:60d90e18]

sgtitle('Step 7: 平日/週末 詳細分析', 'FontSize', 14, 'FontWeight', 'bold'); %[output:60d90e18]

saveas(fig2, fullfile(outputDir, 'Step7_Diff_Analysis.png')); %[output:60d90e18] %[output:9732fd19]
fprintf('図を保存しました\n'); %[output:9468b30b]

%%
%% 7. 結果の保存
step7Results.corrMatrix_weekday = corrMatrix_weekday;
step7Results.corrMatrix_weekend = corrMatrix_weekend;
step7Results.matrix_similarity = matrix_similarity;
step7Results.vec_diff = vec_diff;
step7Results.nWeekday = nWeekday;
step7Results.nWeekend = nWeekend;
step7Results.mean_diff = mean(vec_diff);
step7Results.std_diff = std(vec_diff);

save(fullfile(dataDir, 'step7_results.mat'), 'step7Results');
fprintf('\n結果を保存: %s\n', fullfile(dataDir, 'step7_results.mat')); %[output:0eb7ab92]

fprintf('\n========================================\n'); %[output:721430b9]
fprintf('=== Step 7 完了 ===\n'); %[output:1a40d5a3]
fprintf('========================================\n'); %[output:46aff102]
%%
% Step8実行前の確認箇所
load(fullfile(dataDir, 'step3_results.mat'));
load(fullfile(dataDir, 'step4_results.mat'));
disp('=== step3Results ==='); %[output:6e7c9ebc]
disp(fieldnames(step3Results)); %[output:5abf2fb3]
disp('=== step4Results ==='); %[output:701c642f]
disp(fieldnames(step4Results)); %[output:2c053e23]
%%
disp(fieldnames(step4Results.storeMetrics)); %[output:37742622]


